import React from "react";
import "./MainMenu.css";

const MainMenu: React.FC = () => {
    return (
    <body className="Menu">
        <p className="pivo">
            ГЕРОЙ
        </p>
        <p className="pivo">
            МОНЕТКИ
        </p>
        <p>
            ЭНЕРГИЯ
        </p>
        <p>
            КАРТА
        </p>
        <p>
            ПОКЕМОНЫ
        </p>
        <p>
            НАСТРОЙКИ
        </p>
        <p>
            РЫНОК
        </p>
    </body>
);
};

export default MainMenu;
